import React, { useState,useEffect } from 'react'
import './Login.css'
import AOS from 'aos';
import 'aos/dist/aos.css';
import { assets } from '../assets/assets'
import { useNavigate } from 'react-router-dom';

const Login = ({setLogin}) => {
    const navi=useNavigate()
    useEffect(() => {
        AOS.init({ duration: 2000 });
    }, []);
    function signup(e){
        e.preventDefault()
        navi('/signup')

    }

    return (
        <div  >
        <div className="popup">
            <div   className="popup-inner">
            <h2 className='text-center p-4 '>LOGIN PAGE</h2>
                <img  onClick={()=>setLogin(false)}src={assets.cross_icon}/>
                <form >
                    <label>
                        Username:
                        <input type="text" />
                    </label>
                    <label>
                        Password:
                        <input type="password"  />
                    </label>
                    <div className='button'>
                        <p>Already have an account?</p>
                    
                    <button type="button" className="lo btn">Login here</button>
                  <div className='l1'>
                    <p>Create a new account</p>
                  <button type="button" onClick={signup} className="log btn ">Click here</button>
                  </div>
                    </div>
                    
                    
                </form>
                
            </div>
        </div>
        </div>
    
  )
}

export default Login
